import { Box, Grid } from '@mui/material';
import { useState } from 'react';
import SMInput from '../config/components/input';
import FacebookOutlinedIcon from '@mui/icons-material/FacebookOutlined';
import WhatsappOutlinedIcon from '@mui/icons-material/WhatsappOutlined';
import HotelOutlinedIcon from '@mui/icons-material/HotelOutlined';
import { useNavigate } from 'react-router-dom';
import { sendData } from '../config/firebase/firebasemethods';
import { Rooms } from '../config/components/obj';
import About from './about';
function Mainweb() {

  const [comVal, setcomVal] = useState([]);
  const [addRooms, setaddRooms] = useState(Rooms);
  const navigate = useNavigate()

 

  let signUppage = () => {
    navigate(`/signup`)
  }

  let submit = () => {
    sendData(comVal, `complain`).then((res) => {
      console.log(res)
    }).catch((err) => {
      console.log(err)
    })
    console.log(comVal)
  }

  return (
    <>
      <div className='mainbody'>
        <PrimarySearchAppBar />
        <div className='div1'>
          <img className='imgmain' src={"https://cf.bstatic.com/xdata/images/hotel/max1024x768/257803292.jpg?k=78e57c0acabe8fdac0557960f051e755880276c4934436d58f1e8d26464c8ddc&o=&hp=1"} />
          {/* <SMButton className="book" label={"Book Now"}/> */}
          <div className='book'>
            <button className='mainbtn'>Book Now</button>
          </div>
        </div>
      </div>
      <div className='maincards'>
        <h1 >Rooms</h1>
        <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
          <Grid item md={3}>
            <Extra head={"4 Bedrooms"} pera={"free breakfast"} btn={"Book Now"} image={"https://cf.bstatic.com/xdata/images/hotel/max1024x768/257803292.jpg?k=78e57c0acabe8fdac0557960f051e755880276c4934436d58f1e8d26464c8ddc&o=&hp=1"} />
          </Grid>
          <Grid item md={3}>
            <Extra head={"4 Bedrooms"} pera={"free breakfast"} btn={"Book Now"} image={"https://cf.bstatic.com/xdata/images/hotel/max1024x768/257803292.jpg?k=78e57c0acabe8fdac0557960f051e755880276c4934436d58f1e8d26464c8ddc&o=&hp=1"} />
          </Grid>
          <Grid item md={3}>
            <Extra head={"4 Bedrooms"} pera={"free breakfast"} btn={"Book Now"} image={"https://cf.bstatic.com/xdata/images/hotel/max1024x768/257803292.jpg?k=78e57c0acabe8fdac0557960f051e755880276c4934436d58f1e8d26464c8ddc&o=&hp=1"} />
          </Grid>
          <Grid item md={3}>
            <Extra head={"4 Bedrooms"} pera={"free breakfast"} btn={"Book Now"} image={"https://cf.bstatic.com/xdata/images/hotel/max1024x768/257803292.jpg?k=78e57c0acabe8fdac0557960f051e755880276c4934436d58f1e8d26464c8ddc&o=&hp=1"} />
          </Grid>
        </Grid>
      </div>
      <About/>
     
    </>
  )
}


export default Mainweb
